import React,{Component,useState} from 'react';
import 'tachyons';
import AOS from 'aos';
import {Carousel} from 'react-bootstrap';
import {Testies} from './testimonialnames';


const Test=()=>
{
  const[tests,setTest]=useState(Testies);

return(
<div data-aos="zoom-in" data-aos-easing="ease-in-sine" data-aos-duration="1000">
  <h1>Our <span className="code mb6 mt4">testimonials</span>.</h1>
  <Carousel className="mt2" >
{
    tests.map((test)=>(

   <Carousel.Item className="pa5" >
    <img
      className="d-block w-100"
      src={test.photo}
      alt="First slide"
      className="test"
    />
    <h3 className="mt3">{test.name}</h3>
    <p>{test.description}</p>
  <p className="">{test.date}</p>
  </Carousel.Item>
))
}
</Carousel>
</div>
);
}
export default Test;
